import React from 'react';


const Practice = ({city, search, setSearch}) => {
    return (
        <>
      

        <input type="search" className="input_field" value={search} onChange={ (event) => { setSearch(event.target.value) }}  />
                

                    {
                        !city ? ( <p className="errormsg">NO DATA FOUND!!</p> ) :
                        (
                            <>
                                <div className="info">
                                    <h2 className="location"> <i class="fa fa-map-marker"></i>  {search} </h2>
                                    <h1 className="temp"> {city.temp} °C </h1>
                                    <h3 className="tempmin_max"> Min : {city.temp_min} °C | Max : {city.temp_max} °C </h3>
                                </div>
                            </>
                        )
                    }

             
        </>
    )
}

export default Practice
